import React from "react";
import Navbar from "./Navbar";
import { Bar, Pie, Line } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  ArcElement,
  PointElement,
  LineElement,
  Tooltip,
  Legend
} from "chart.js";

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  ArcElement,
  PointElement,
  LineElement,
  Tooltip,
  Legend
);

const Analysis = () => {

  /* ===== DATA (SYNTHETIC but REALISTIC) ===== */

  const categorySales = {
    labels: ["Electronics", "Grocery", "Home & Kitchen", "Clothing", "Personal Care"],
    datasets: [
      { label: "Sales (₹ Cr)", data: [9.5, 5.0, 4.2, 4.1, 2.7], backgroundColor: "#f97316" },
      { label: "Profit (₹ Cr)", data: [2.8, 1.2, 1.0, 1.1, 0.6], backgroundColor: "#22c55e" }
    ]
  };

  const outletTypeSales = {
    labels: ["Hypermarket", "Supermarket", "Convenience Store"],
    datasets: [{ data: [14.0, 8.5, 2.9], backgroundColor: ["#f97316", "#fb923c", "#fdba74"] }]
  };

  const storeSizeSales = {
    labels: ["Small", "Medium", "Large"],
    datasets: [{ data: [32, 55, 72], backgroundColor: "#f97316" }]
  };

  const ageSales = {
    labels: ["18-25", "26-35", "36-45", "46+"],
    datasets: [{ data: [3.5, 5.0, 4.0, 4.2], backgroundColor: "#f97316" }]
  };

  const cityTier = {
    labels: ["Tier 1", "Tier 2", "Tier 3"],
    datasets: [{ data: [62, 25, 13], backgroundColor: ["#f97316", "#fb923c", "#fdba74"] }]
  };

  const statesPerformance = {
    labels: ["Delhi", "Maharashtra", "West Bengal", "Karnataka", "Telangana"],
    datasets: [
      { label: "Sales (₹ Cr)", data: [4.1, 3.8, 3.5, 2.9, 2.1], backgroundColor: "#f97316" },
      { label: "Growth %", data: [18, 15, 17, 14, 21], borderColor: "#22c55e", type: "line" }
    ]
  };

  return (
    <div style={page}>
      <Navbar />

      <h2>Deep Sales Analysis</h2>
      <p style={subtitle}>Understand patterns, trends, and insights behind the numbers</p>

      {/* FILTERS */}
      <div style={card}>
        <h4>Analysis Filters</h4>
        <div style={filters}>
          <select><option>All Years</option></select>
          <select><option>All Categories</option></select>
          <select><option>All Regions</option></select>
          <select><option>All Outlet Types</option></select>
        </div>
      </div>

      {/* CATEGORY ANALYSIS */}
      <div style={grid2}>
        <div style={card}>
          <h4>Category-wise Sales & Profit</h4>
          <Bar data={categorySales} />
        </div>

        <div style={card}>
          <h4>Sales by Outlet Type</h4>
          <Pie data={outletTypeSales} />
        </div>
      </div>

      {/* STORE ANALYSIS */}
      <div style={grid2}>
        <div style={card}>
          <h4>Average Sales by Store Size</h4>
          <Bar data={storeSizeSales} />
        </div>

        <div style={card}>
          <h4>Sales Distribution by Age Group</h4>
          <Bar data={ageSales} />
        </div>
      </div>

      {/* DEMOGRAPHICS */}
      <div style={grid2}>
        <div style={card}>
          <h4>Sales Distribution by City Tier</h4>
          <Pie data={cityTier} />
        </div>

        <div style={card}>
          <h4>Top Performing States</h4>
          <Line data={statesPerformance} />
        </div>
      </div>
    </div>
  );
};

/* ===== STYLES ===== */

const page = {
  background: "#f8fafc",
  minHeight: "100vh",
  padding: "20px"
};

const subtitle = {
  color: "#64748b",
  marginBottom: "20px"
};

const card = {
  background: "#fff",
  padding: "20px",
  borderRadius: "14px",
  boxShadow: "0 6px 18px rgba(0,0,0,0.05)",
  marginBottom: "20px"
};

const filters = {
  display: "flex",
  gap: "14px",
  flexWrap: "wrap"
};

const grid2 = {
  display: "grid",
  gridTemplateColumns: "1fr 1fr",
  gap: "20px"
};

export default Analysis;
